import Logo from '../images/logo.svg';
function Header(){
    return (
    <header>
        <div><img src={Logo} alt="Snap" /></div>
        <div>
            <ol>
                <li>Features</li>
                <li>Company</li>
                <li>Careers</li>
                <li>About</li>
            </ol>
        </div>
        <div></div>
    </header>
    );
}
export default Header;
